using System;
using System.Linq;
					
public class Program
{
	public static void Main()
	{
		Console.WriteLine(Day1() + " " + Day2());
	}
	
	public static int Day1() => Calc(4);
	public static int Day2() => Calc(14);
	
	public static int Calc(int max)
	{
		for (int i = 0; i < input.Length - max; i++)
			if (input.Substring(i, max).Distinct().Count() == max) return i + max;
		return -1;
	}
public static string input = "";
}
